import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = ({ title, url }) => {
  return (
    <div className="navbar">
      <Link to={`/${encodeURIComponent(url)}`}>
        <h2 className="title">{title}</h2>
      </Link>
    </div>
  );
};

export default Navbar;
